import "./Myservice.css";
const Myservice = ({ imgSrc, title, content }) => {
  return (
    <div className="myservice">
      <div className="ms-content">
        <img src={imgSrc}></img>
        <span>{title}</span>
        <span>{content}</span>
        <button className="ms-btn">LEARN MORE</button>
      </div>
    </div>
  );
};

export default Myservice;
